  display: flex;
  justify-items: center;
  align-items: center;
  flex-direction: column;
  width: 112px;
  height: 112px;
  padding: 16px 0 0;
  margin-bottom: 20px;
  margin-right: 5px;
  position: relative;
  border-radius: 8px;
  /* background: white; */
}
li:hover {
  background: rgb(232, 232, 232);
  cursor: pointer;
}
.siteList .site {
  width: 45px;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  border-radius: 10px;
  position: relative;
  cursor: pointer;
}

.siteList .site > .logo {
  width: 50px;
  height: 50px;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 50px;
  margin-left: 66px;
  margin-top: 11px;
}
.link {
  margin-top: 5px;
}
li > .close {
  display: none;
  position: absolute;
  right: 10px;
  top: 5px;
  display: none;
  cursor: pointer;
  position: absolute;
}

li > .close > .icon {
  color: #9aa0a6;
  width: 20px;
  height: 20px;
  position: relative;
  left: 8px;
  top: -4px;
}
li > .close > .icon:hover {
  color: black;
}
li:hover > .close {
  display: block;
}
.addButton {
  display: flex;
  flex-direction: column;
  align-items: center;
}
.siteList .addButton .icon {
  width: 42px;
  height: 42px;
  display: flex;
  justify-content: center;
  align-items: center;
}
.siteList .addButton .icon-wrapper {
  width: 60px;
  height: 60px;
  display: flex;
  justify-content: center;
  align-items: center;
}
#liyi {
  max-width: 100%;
  max-height: 100%;
  display: flex;
  justify-content: center;
}
#liyi > img {
  width: 150px;
  /* height: 150px; */
  margin-bottom: -40px;
}

